import { Link } from "react-router-dom";

import "./gameInList.css"

const GameInlist = (props) => {

    return (
        <a className="gameLink" href={"http://localhost:3000/videogame/" + props.children.videogameId}>
            <div className="imgContainer">
                <img className="img" src={"data:image/png;base64," + props.children.cover}/>
                <div>sdnl</div>
            </div>
        </a>

    )

}

export default GameInlist;
